import { Stack } from '@mui/system';
import GroupIcon from '@mui/icons-material/Group';
import { formHelperTextClasses } from '@mui/material';

const Sidebar = () => {
    return (
        <Stack
  direction="column"
  justifyContent="space-around"
  alignItems="center"
  spacing={2}
  sx={{mt:'20px'}}
>
<div sx={{display:"flex",flexDirection:"row",justifyContent:"space-around",alignItems:'center'}}>
<GroupIcon/>
   <div>GSTIN list</div>
   </div> 
   <div>Return Status</div>
</Stack>
    );
}

export default Sidebar;
